ED1.ICD_DIAG_TYP_CD ICD_DIAG_TYP_CD,
NULL BIL_RVNU_CD,
CASE WHEN CLM.ALLOWED_REASON_DIM_ID > 0 THEN ALLOW.REASON_DESC ELSE NOTC.REASON_DESC END CLM_TRANS_RSN_DESC,
NULL CLM_TRANS_UNET_RDUC_RSN_CD,
NULL CLM_TRANS_UNET_RDUC_RSN_DESC,
COALESCE(ED1.DSM_TYP_CD, DI1.CODE_TYPE) CLM_TRANS_DIAG_1_DSM_TYP_CD,
COALESCE(ED2.DSM_TYP_CD, DI2.CODE_TYPE) CLM_TRANS_DIAG_2_DSM_TYP_CD,
COALESCE(ED3.DSM_TYP_CD, DI3.CODE_TYPE) CLM_TRANS_DIAG_3_DSM_TYP_CD,
COALESCE(ED4.DSM_TYP_CD, DI4.CODE_TYPE) CLM_TRANS_DIAG_4_DSM_TYP_CD,
COALESCE(ED5.DSM_TYP_CD, DI5.CODE_TYPE) CLM_TRANS_DIAG_5_DSM_TYP_CD,
EOB.REASON_CODE CLM_TRANS_CLM_LVL_RSN_CD,
NULL CLM_TRANS_EOB_RSN_CD,
PM2.MODIFIER_CODE CLM_TRANS_PROC_MOD_2_CD,
PM3.MODIFIER_CODE CLM_TRANS_PROC_MOD_3_CD,
PM4.MODIFIER_CODE CLM_TRANS_PROC_MOD_4_CD,
REV.PROCEDURE_CODE CLM_TRANS_RVNU_CD,
REV.PROCEDURE_CODE_LONG_DESC CLM_TRANS_RVNU_DESC,
PRC.PROCEDURE_CODE CLM_TRANS_SEC_PROC_CD,
PRC.PROCEDURE_CODE_SHORT_DESC CLM_TRANS_SEC_PROC_DESC,
PRC.CODE_TYPE CLM_TRANS_SEC_PROC_TYP_CD,
CLT.CLAIM_TYPE SRC_FINC_LIAB_CD,
CASE WHEN CLM.CLAIM_TYPE_DIM_ID IN (6,7,8) THEN ''TRUE'' ELSE ''FALSE'' END DERIV_OBH_FINC_LIAB,
