CLM.PROVIDER_NPI CLM_SRC_PROV_CLM_PAYE_NPI_ID,
CLM.SRC_ADMITTING_NPI CLM_SRC_PROV_CLM_ADMIT_NPI_ID,
CLM.ATT_PROV_NPI CLM_SRC_PROV_CLM_ATD_NPI_ID,
NULL PND_CLM_FLG,
'''' CLM_TRANS_BIL_PROC_CD,
''Unknown'' CLM_TRANS_BIL_PROC_DESC,
''U'' CLM_TRANS_BIL_PROC_TYP_CD,
