NULL CSP_NTWX_PRCNG_CLM_BASED_DESC,
NULL CLM_TRANS_CLM_ACT_RATE_SRC,
NULL CLM_TRANS_OON_MTHDLGY,
WCS.WHOLE_CLAIM_STATUS_DESC	CLM_TRANS_RSN_TYP_DESC,
CLT.CLAIM_TYPE_DESC SRC_FINC_LIAB_DESC,
COALESCE(ED1.DIAG_CATGY_DERIV_DESC, CT12.DIAG_CAT_LVL_2_DESC) CLM_TRANS_DIAG_1_CD_CATGY_LVL_2_DESC,
COALESCE(ED2.DIAG_CATGY_DERIV_DESC, CT22.DIAG_CAT_LVL_2_DESC) CLM_TRANS_DIAG_2_CD_CATGY_LVL_2_DESC,
COALESCE(ED3.DIAG_CATGY_DERIV_DESC, CT32.DIAG_CAT_LVL_2_DESC) CLM_TRANS_DIAG_3_CD_CATGY_LVL_2_DESC,
COALESCE(ED4.DIAG_CATGY_DERIV_DESC, CT42.DIAG_CAT_LVL_2_DESC) CLM_TRANS_DIAG_4_CD_CATGY_LVL_2_DESC,
COALESCE(ED5.DIAG_CATGY_DERIV_DESC, CT52.DIAG_CAT_LVL_2_DESC) CLM_TRANS_DIAG_5_CD_CATGY_LVL_2_DESC,
:3
FROM COMPACT.FACT_CLAIM CLM
LEFT JOIN COMPACT.DIM_COMPANY CMP ON CLM.COMPANY_DIM_ID = CMP.COMPANY_DIM_ID
LEFT JOIN COMPACT.DIM_CONVERTED_FROM COF ON COF.CONVERTED_FROM_DIM_ID = CLM.CONVERTED_FROM_DIM_ID
LEFT JOIN COMPACT.DIM_PLAN PLN ON PLN.PLAN_DIM_ID = CLM.PLAN_DIM_ID
                                 AND CLM.COMPANY_DIM_ID = PLN.ETL_COMPANY_DIM_ID
LEFT JOIN COMPACT.DIM_MEMBER MMB ON  CLM.MEMB_DIM_ID = MMB.MEMB_DIM_ID
LEFT JOIN COMPACT.DIM_SOURCE_PRODUCT SRP ON SRP.SOURCE_PRODUCT_DIM_ID = CLM.SOURCE_PRODUCT_DIM_ID
LEFT JOIN COMPACT.DIM_VENDOR VEN ON VEN.VEND_DIM_ID = CLM.VEND_DIM_ID
LEFT JOIN COMPACT.DIM_PROVIDER PRV ON PRV.PROV_DIM_ID = CLM.PROV_DIM_ID
LEFT JOIN COMPACT.DIM_PROVIDER_FACILITY PFA ON PRV.MPIN = PFA.MPIN AND PRV.PROV_GEOG_ZIP = PFA.ZIP
LEFT JOIN COMPACT.DIM_AUTO_ADJUD_FLAG ADJ ON ADJ.AUTO_ADJUD_FLAG_DIM_ID = CLM.AUTO_ADJUD_FLAG_DIM_ID
LEFT JOIN COMPACT.DIM_DIAGNOSIS DI1 ON CLM.DIAGNOSIS_1_DIM_ID = DI1.DIAGNOSIS_DIM_ID
LEFT JOIN COMPACT.DIM_DIAG_CAT_LVL_1 CT11 ON DI1.DIAG_CAT_LVL_1_DIM_ID = CT11.DIAG_CAT_LVL_1_DIM_ID
LEFT JOIN COMPACT.DIM_DIAG_CAT_LVL_2 CT12 ON DI1.DIAG_CAT_LVL_2_DIM_ID = CT12.DIAG_CAT_LVL_2_DIM_ID
LEFT JOIN COMPACT.DIM_DIAGNOSIS DI2 ON CLM.DIAGNOSIS_2_DIM_ID = DI2.DIAGNOSIS_DIM_ID
LEFT JOIN COMPACT.DIM_DIAG_CAT_LVL_1 CT21 ON DI2.DIAG_CAT_LVL_1_DIM_ID = CT21.DIAG_CAT_LVL_1_DIM_ID
LEFT JOIN COMPACT.DIM_DIAG_CAT_LVL_2 CT22 ON DI2.DIAG_CAT_LVL_2_DIM_ID = CT22.DIAG_CAT_LVL_2_DIM_ID
LEFT JOIN COMPACT.DIM_DIAGNOSIS DI3 ON CLM.DIAGNOSIS_3_DIM_ID = DI3.DIAGNOSIS_DIM_ID
LEFT JOIN COMPACT.DIM_DIAG_CAT_LVL_1 CT31 ON DI3.DIAG_CAT_LVL_1_DIM_ID = CT31.DIAG_CAT_LVL_1_DIM_ID
LEFT JOIN COMPACT.DIM_DIAG_CAT_LVL_2 CT32 ON DI3.DIAG_CAT_LVL_2_DIM_ID = CT32.DIAG_CAT_LVL_2_DIM_ID
LEFT JOIN COMPACT.DIM_DIAGNOSIS DI4 ON CLM.DIAGNOSIS_4_DIM_ID = DI4.DIAGNOSIS_DIM_ID
LEFT JOIN COMPACT.DIM_DIAG_CAT_LVL_1 CT41 ON DI4.DIAG_CAT_LVL_1_DIM_ID = CT41.DIAG_CAT_LVL_1_DIM_ID
LEFT JOIN COMPACT.DIM_DIAG_CAT_LVL_2 CT42 ON DI4.DIAG_CAT_LVL_2_DIM_ID = CT42.DIAG_CAT_LVL_2_DIM_ID
LEFT JOIN COMPACT.DIM_DIAGNOSIS DI5 ON CLM.DIAGNOSIS_5_DIM_ID = DI5.DIAGNOSIS_DIM_ID
LEFT JOIN COMPACT.DIM_DIAG_CAT_LVL_1 CT51 ON DI5.DIAG_CAT_LVL_1_DIM_ID = CT51.DIAG_CAT_LVL_1_DIM_ID
LEFT JOIN COMPACT.DIM_DIAG_CAT_LVL_2 CT52 ON DI5.DIAG_CAT_LVL_2_DIM_ID = CT52.DIAG_CAT_LVL_2_DIM_ID
LEFT JOIN (SELECT DISTINCT DIAG_CD, DIAG_CATGY_DERIV_DESC, DIAG_DERIV_TYP_CD, MH_SA_CD, DIAG_DERIV_DESC,
ICD_DIAG_TYP_CD, DSM_TYP_CD FROM ETL.EDW_TB_DIAG_L
WHERE :2 BETWEEN DIAG_EFF_DT AND DIAG_EXPR_DT) ED1 ON DI1.DIAGNOSIS_NODECM_CODE = ED1.DIAG_CD
LEFT JOIN (SELECT DISTINCT DIAG_CD, DIAG_CATGY_DERIV_DESC, DIAG_DERIV_TYP_CD, MH_SA_CD, DIAG_DERIV_DESC,
ICD_DIAG_TYP_CD, DSM_TYP_CD FROM ETL.EDW_TB_DIAG_L
WHERE :2 BETWEEN DIAG_EFF_DT AND DIAG_EXPR_DT) ED2 ON DI2.DIAGNOSIS_NODECM_CODE = ED2.DIAG_CD
LEFT JOIN (SELECT DISTINCT DIAG_CD, DIAG_CATGY_DERIV_DESC, DIAG_DERIV_TYP_CD, MH_SA_CD, DIAG_DERIV_DESC,
ICD_DIAG_TYP_CD, DSM_TYP_CD FROM ETL.EDW_TB_DIAG_L
WHERE :2 BETWEEN DIAG_EFF_DT AND DIAG_EXPR_DT) ED3 ON DI3.DIAGNOSIS_NODECM_CODE = ED3.DIAG_CD
LEFT JOIN (SELECT DISTINCT DIAG_CD, DIAG_CATGY_DERIV_DESC, DIAG_DERIV_TYP_CD, MH_SA_CD, DIAG_DERIV_DESC,
ICD_DIAG_TYP_CD, DSM_TYP_CD FROM ETL.EDW_TB_DIAG_L
WHERE :2 BETWEEN DIAG_EFF_DT AND DIAG_EXPR_DT) ED4 ON DI4.DIAGNOSIS_NODECM_CODE = ED4.DIAG_CD
LEFT JOIN (SELECT DISTINCT DIAG_CD, DIAG_CATGY_DERIV_DESC, DIAG_DERIV_TYP_CD, MH_SA_CD, DIAG_DERIV_DESC,
ICD_DIAG_TYP_CD, DSM_TYP_CD FROM ETL.EDW_TB_DIAG_L
WHERE :2 BETWEEN DIAG_EFF_DT AND DIAG_EXPR_DT) ED5 ON DI5.DIAGNOSIS_NODECM_CODE = ED5.DIAG_CD
LEFT JOIN COMPACT.DIM_PLACE_OF_SVC SVC ON CLM.PLACE_OF_SVC_1_DIM_ID = SVC.PLACE_OF_SVC_DIM_ID
LEFT JOIN COMPACT.DIM_BILL_TYPE BIT ON CLM.BILL_TYPE_DIM_ID = BIT.BILL_TYPE_DIM_ID
LEFT JOIN COMPACT.DIM_DRG_CODE DRG ON CLM.DRG_CODE_DIM_ID = DRG.DRG_CODE_DIM_ID
LEFT JOIN COMPACT.DIM_PROCEDURE_CODE REV ON CLM.REVENUE_CODE_DIM_ID = REV.PROCEDURE_DIM_ID
LEFT JOIN COMPACT.DIM_PROCEDURE_CODE PRC ON CLM.CPT_CODE_DIM_ID = PRC.PROCEDURE_DIM_ID
LEFT JOIN COMPACT.DIM_REASON_CODE ALLOW ON CLM.ALLOWED_REASON_DIM_ID = ALLOW.REASON_DIM_ID
LEFT JOIN COMPACT.DIM_REASON_CODE NOTC ON CLM.NOT_COVERED_REASON_DIM_ID = NOTC.REASON_DIM_ID
LEFT JOIN COMPACT.DIM_REASON_CODE EOB ON CLM.EOB_DIM_ID = EOB.REASON_DIM_ID
LEFT JOIN COMPACT.DIM_COS_STL_4 CO1 ON CO1.COS_STL_4_DIM_ID = CLM.COS_STL_4_DIM_ID
LEFT JOIN COMPACT.DIM_BILL_TYPE_CAT_LVL_1 BT1 ON BT1.BILL_TYPE_CAT_LVL_1_DIM_ID = BIT.BILL_TYPE_CAT_LVL_1_DIM_ID
LEFT JOIN COMPACT.DIM_PROCEDURE_MODIFIER PMO ON CLM.CPT_MODIFIER_DIM_ID = PMO.MODIFIER_DIM_ID
LEFT JOIN COMPACT.DIM_PROCEDURE_MODIFIER PM2 ON CLM.CPT_MODIFIER_2_DIM_ID = PM2.MODIFIER_DIM_ID
LEFT JOIN COMPACT.DIM_PROCEDURE_MODIFIER PM3 ON CLM.CPT_MODIFIER_3_DIM_ID = PM3.MODIFIER_DIM_ID
LEFT JOIN COMPACT.DIM_PROCEDURE_MODIFIER PM4 ON CLM.CPT_MODIFIER_4_DIM_ID = PM4.MODIFIER_DIM_ID
LEFT JOIN COMPACT.DIM_ADMIT_SOURCE ADS ON ADS.ADMIT_SOURCE_DIM_ID = CLM.ADMIT_SOURCE_DIM_ID
LEFT JOIN COMPACT.DIM_PROVIDER_CONTRACT CTR  ON CLM.CONTRACT_DIM_ID = CTR.CONTRACT_DIM_ID
LEFT JOIN COMPACT.DIM_PROV_AGREEMENT  PAG ON CTR.PROV_AGREEMENT_DIM_ID = PAG.PROV_AGREEMENT_DIM_ID
LEFT JOIN COMPACT.DIM_LINE_OF_BUSINESS LIB ON CLM.LINE_OF_BUSINESS_DIM_ID = LIB.LINE_OF_BUSINESS_DIM_ID
LEFT JOIN COMPACT.DIM_CARE_LEVEL CRL ON CLM.CARE_LEVEL_DIM_ID = CRL.CARE_LEVEL_DIM_ID
LEFT JOIN COMPACT.DIM_CLAIM_TYPE CLT ON CLM.CLAIM_TYPE_DIM_ID = CLT.CLAIM_TYPE_DIM_ID
LEFT JOIN COMPACT.DIM_WHOLE_CLAIM_STATUS WCS ON WCS.WHOLE_CLAIM_STATUS_DIM_ID = CLM.WHOLE_CLAIM_STATUS_DIM_ID
WHERE CLM.CLAIM_TYPE_DIM_ID NOT IN (3, 8);',CURRENT_TIMESTAMP),
('ETL.EDW_TB_DIM_MBR_L','COMPACT.IMDM_EDW_INDV_KEY','INSERT INTO COMPACT.IMDM_EDW_INDV_KEY(INDV_KEY_VAL, INDV_KEY_TYP_REF_DESC, CREAT_SYS_REF_CD ,CHG_SYS_REF_CD, DATA_SECUR_RULE_LIST, IMDM_SURRG_KEY,	INDV_SRC_ID, DW_SYS_REF_CD, SF_INSERT_DATETIME, SF_UPDATE_DATETIME, SF_PROCESS_ID)  
(SELECT DISTINCT INDV_KEY_VAL,''edwPersonIdentifier'' AS INDV_KEY_TYP_REF_DESC, '''' AS CREAT_SYS_REF_CD, '''' AS CHG_SYS_REF_CD, parse_json(''{"securityTag":"AR_DEV_OBHDPSAS_OPTUM_ROLE"}''),''-999'' as IMDM_SURRG_KEY, IMDMID, ''OBHDP'',CURRENT_TIMESTAMP, CURRENT_TIMESTAMP,:3
FROM
(
SELECT DISTINCT EDWPERSID AS INDV_KEY_VAL, IMDMID
FROM
(
(SELECT DISTINCT EDWCES.MBR_PERS_SYS_ID as EDWPERSID, EDWCES.MBR_ALT_ID,CES.INDV_SRC_ID AS IMDMID, CES.MBR_ALT_ID, CES.CREAT_DTTM, CES.CHG_DTTM, EDWCES.SRC_REC_CD FROM
 (SELECT DISTINCT INDV_KEY_VAL, INDV_SRC_ID, concat(''CES-'',SUBSTR(INDV_KEY_VAL,0,7),''-'',SUBSTR(INDV_KEY_VAL,10,9),''-'',SUBSTR(INDV_KEY_VAL,20,1),''-'',SUBSTR(INDV_KEY_VAL,22,2)) as mbr_alt_id, CREAT_DTTM, CHG_DTTM FROM ECT_{env}_INDIVIDUAL_DB.COMPACT.IMDM_INDV_KEY
WHERE  TRIM(CREAT_SYS_REF_CD)=''CDB_CS'' AND TRIM(INDV_KEY_TYP_REF_DESC)=''sourceId'' AND SRC_REC_STS_CD=''true'' )CES JOIN
(SELECT DISTINCT MBR_PERS_SYS_ID, MBR_ALT_ID, SRC_REC_CD FROM ECT_{env}_OBH_DP_DB.ETL.EDW_TB_DIM_MBR_L WHERE TRIM(SRC_REC_CD)=''CES'') EDWCES
ON TRIM(EDWCES.MBR_ALT_ID)=CES.MBR_ALT_ID
)
UNION
(SELECT DISTINCT EDWCSP.MBR_PERS_SYS_ID as EDWPERSID, EDWCSP.MBR_ALT_ID,CSP.INDV_SRC_ID AS IMDMID, CSP.MBR_ALT_ID, CSP.CREAT_DTTM, CSP.CHG_DTTM, EDWCSP.SRC_REC_CD FROM
  (SELECT distinct indv.indv_key_val, indv.indv_src_id, concat(''CSP-'',TRIM(pol.INDV_KEY_VAL),''-'',SUBSTR(indv.INDV_KEY_VAL,0,9),''-'',SUBSTR(indv.INDV_KEY_VAL,12,1)) as mbr_alt_id, INDV.CREAT_DTTM, INDV.CHG_DTTM
FROM (select distinct indv_key_val, indv_src_id,IMDM_SURRG_KEY, CREAT_DTTM, CHG_DTTM from ECT_{env}_INDIVIDUAL_DB.COMPACT.IMDM_INDV_KEY
WHERE  TRIM(CREAT_SYS_REF_CD)=''CSP_Facets'' AND TRIM(INDV_KEY_TYP_REF_DESC)=''sourceId'' AND SRC_REC_STS_CD=''true'') indv
inner join
(select distinct indv_key_val, indv_src_id,IMDM_SURRG_KEY from ECT_{env}_INDIVIDUAL_DB.COMPACT.IMDM_INDV_KEY
WHERE  TRIM(CREAT_SYS_REF_CD)=''CSP_Facets'' AND TRIM(INDV_KEY_TYP_REF_DESC)=''policyNumber'' AND SRC_REC_STS_CD=''true'')pol
on pol.INDV_SRC_ID=indv.INDV_SRC_ID and indv.IMDM_SURRG_KEY=pol.IMDM_SURRG_KEY) CSP JOIN
(SELECT DISTINCT MBR_PERS_SYS_ID, MBR_ALT_ID, SRC_REC_CD FROM ECT_{env}_OBH_DP_DB.ETL.EDW_TB_DIM_MBR_L WHERE TRIM(SRC_REC_CD)=''CSP'') EDWCSP
ON TRIM(EDWCSP.MBR_ALT_ID)=CSP.MBR_ALT_ID
)
union
(
SELECT DISTINCT EDWCR.MBR_PERS_SYS_ID as EDWPERSID, EDWCR.MBR_ALT_ID,CR.INDV_SRC_ID AS IMDMID, CR.MBR_ALT_ID, CR.CREAT_DTTM, CR.CHG_DTTM, EDWCR.SRC_REC_CD FROM 
(
SELECT distinct indv.indv_key_val, indv.indv_src_id,concat(''CRR-'',TRIM(indv.INDV_KEY_VAL),''-'',pol.pol,''-'',sbscrinfo.sbscrsrcid) as mbr_alt_id, INDV.CREAT_DTTM, INDV.CHG_DTTM
FROM (select distinct indv_key_val, indv_src_id,IMDM_SURRG_KEY,CREAT_DTTM, CHG_DTTM from ECT_{env}_INDIVIDUAL_DB.COMPACT.IMDM_INDV_KEY
WHERE  TRIM(CREAT_SYS_REF_CD)=''CR'' AND TRIM(INDV_KEY_TYP_REF_DESC)=''sourceId'' AND SRC_REC_STS_CD=''true'') indv
inner join
(select distinct indv_key_val pol, indv_src_id indvid,IMDM_SURRG_KEY from ECT_{env}_INDIVIDUAL_DB.COMPACT.IMDM_INDV_KEY
WHERE  TRIM(CREAT_SYS_REF_CD)=''CR'' AND TRIM(INDV_KEY_TYP_REF_DESC)=''policyNumber'' AND SRC_REC_STS_CD=''true'')pol
on pol.INDVID=indv.INDV_SRC_ID and indv.IMDM_SURRG_KEY=pol.IMDM_SURRG_KEY
inner join
(select indv_src_id, indv_key_val, imdm_surrg_key from ECT_{env}_INDIVIDUAL_DB.COMPACT.IMDM_INDV_KEY
   WHERE TRIM(CREAT_SYS_REF_CD)=''CR'' AND SRC_REC_STS_CD=''true'' and TRIM(INDV_KEY_TYP_REF_DESC)=''subscriberId'')mbrsbscr
on mbrsbscr.indv_src_id=indv.indv_src_id and indv.IMDM_SURRG_KEY=mbrsbscr.imdm_surrg_key
INNER JOIN
(select sbscr.indv_src_id sbscrindvid,sbscr.indv_key_val sbscrid, sbscr.imdm_surrg_key, sbsrcid.sbscrsrcid, mbrid, sbscrpol from
  (select indv_src_id, indv_key_val, imdm_surrg_key from ECT_{env}_INDIVIDUAL_DB.COMPACT.IMDM_INDV_KEY 
   WHERE TRIM(CREAT_SYS_REF_CD)=''CR'' AND SRC_REC_STS_CD=''true'' and TRIM(INDV_KEY_TYP_REF_DESC)=''subscriberId''
)sbscr inner join
(SELECT distinct indv_key_val mbrid, indv_src_id mbrindvid,IMDM_SURRG_KEY from ECT_{env}_INDIVIDUAL_DB.COMPACT.IMDM_INDV_KEY 
 WHERE  TRIM(CREAT_SYS_REF_CD)=''CR'' AND TRIM(INDV_KEY_TYP_REF_DESC)=''memberId'' AND SRC_REC_STS_CD=''true'')mbr
on sbscr.indv_key_val=mbr.mbrid and mbr.IMDM_SURRG_KEY=sbscr.IMDM_SURRG_KEY
 inner join
 (select distinct indv_key_val sbscrsrcid, indv_src_id sbscrindvid,IMDM_SURRG_KEY from ECT_{env}_INDIVIDUAL_DB.COMPACT.IMDM_INDV_KEY
WHERE  TRIM(CREAT_SYS_REF_CD)=''CR'' AND TRIM(INDV_KEY_TYP_REF_DESC)=''sourceId'' AND SRC_REC_STS_CD=''true'')sbsrcid
 on sbscr.indv_src_id=sbsrcid.sbscrindvid and sbsrcid.IMDM_SURRG_KEY=sbscr.IMDM_SURRG_KEY
 inner join
 (select distinct indv_key_val sbscrpol, indv_src_id sbscrindvid,IMDM_SURRG_KEY from ECT_{env}_INDIVIDUAL_DB.COMPACT.IMDM_INDV_KEY
WHERE  TRIM(CREAT_SYS_REF_CD)=''CR'' AND TRIM(INDV_KEY_TYP_REF_DESC)=''policyNumber'' AND SRC_REC_STS_CD=''true'')sbscrpol
on sbscrpol.sbscrindvid=sbscr.indv_src_id and sbscr.IMDM_SURRG_KEY=sbscrpol.IMDM_SURRG_KEY
)sbscrinfo
on sbscrinfo.sbscrpol=pol.pol and sbscrinfo.sbscrid=mbrsbscr.indv_key_val
)CR JOIN
(SELECT DISTINCT MBR_PERS_SYS_ID, MBR_ALT_ID, SRC_REC_CD FROM ECT_{env}_OBH_DP_DB.ETL.EDW_TB_DIM_MBR_L WHERE TRIM(SRC_REC_CD)=''CRR'') EDWCR
ON TRIM(EDWCR.MBR_ALT_ID)=CR.MBR_ALT_ID
)
UNION
(
SELECT DISTINCT EDWOHBS.MBR_PERS_SYS_ID as EDWPERSID, EDWOHBS.MBR_ALT_ID,OHBS.INDVID AS IMDMID, OHBS.MBR_ALT_ID, CREAT_DTTM, CHG_DTTM, EDWOHBS.SRC_REC_CD FROM
( 
SELECT indv.indv_key_val sbscrid, indv.indv_src_id indvid, concat(''FCET-'',TRIM(indvpol.indv_key_val),''-'',TRIM(indv.indv_key_val),''-'',TRIM(DPN.dpncd)) AS MBR_ALT_ID, INDV.CREAT_DTTM, INDV.CHG_DTTM 
 FROM 
   (select indv_src_id, indv_key_val, imdm_surrg_key, CREAT_DTTM, CHG_DTTM from ECT_{env}_INDIVIDUAL_DB.COMPACT.IMDM_INDV_KEY
   WHERE TRIM(CREAT_SYS_REF_CD)=''OHBS_Facets'' AND SRC_REC_STS_CD=''true'' and TRIM(INDV_KEY_TYP_REF_DESC)=''subscriberId'')indv 
 join 
 (select distinct indv_key_val, indv_src_id,IMDM_SURRG_KEY from ECT_{env}_INDIVIDUAL_DB.COMPACT.IMDM_INDV_KEY
WHERE  TRIM(CREAT_SYS_REF_CD)=''OHBS_Facets'' AND TRIM(INDV_KEY_TYP_REF_DESC)=''policyNumber'' AND SRC_REC_STS_CD=''true'') indvpol 
  on indv.indv_src_id=indvpol.indv_src_id and indv.IMDM_SURRG_KEY=indvpol.IMDM_SURRG_KEY
 JOIN
(SELECT distinct indv_key_val, indv_src_id,IMDM_SURRG_KEY, CASE WHEN TRIM(indv_key_val)=''M'' THEN ''0'' WHEN TRIM(indv_key_val) IN (''W'',''H'') THEN ''1'' END as dpncd from ECT_{env}_INDIVIDUAL_DB.COMPACT.IMDM_INDV_KEY 
 WHERE  TRIM(CREAT_SYS_REF_CD)=''OHBS_Facets'' AND TRIM(INDV_KEY_TYP_REF_DESC)=''dependentCode'' AND SRC_REC_STS_CD=''true'' AND INDV_KEY_VAL IN (''M'',''W'',''H'')
)DPN
ON DPN.indv_src_id= INDV.indv_src_id and indv.IMDM_SURRG_KEY=DPN.IMDM_SURRG_KEY
)OHBS JOIN
(SELECT DISTINCT MBR_PERS_SYS_ID, MBR_ALT_ID, SRC_REC_CD FROM ECT_{env}_OBH_DP_DB.ETL.EDW_TB_DIM_MBR_L WHERE TRIM(SRC_REC_CD)=''FCET'') EDWOHBS
ON TRIM(EDWOHBS.MBR_ALT_ID)=OHBS.MBR_ALT_ID
)
UNION
(
SELECT DISTINCT EDWMCD.MBR_PERS_SYS_ID as EDWPERSID, EDWMCD.MEDCD_ID,MCD.INDV_SRC_ID AS IMDMID, MCD.INDV_KEY_VAL, MCD.CREAT_DTTM, MCD.CHG_DTTM, EDWMCD.SRC_REC_CD FROM
(SELECT DISTINCT INDV_SRC_ID, INDV_KEY_VAL, CREAT_DTTM, CHG_DTTM FROM ECT_{env}_INDIVIDUAL_DB.COMPACT.IMDM_INDV_KEY 
 WHERE TRIM(INDV_KEY_TYP_REF_DESC)=''medicaidRecipientNumber''AND SRC_REC_STS_CD=''true'')MCD JOIN 
 (SELECT INDV_SRC_ID, BIRTHDATE FROM ECT_{env}_INDIVIDUAL_DB.COMPACT.IMDM_INDV_DEMOGRAPHICINFO WHERE UPPER(TRIM(ACTIVE))=''TRUE'') DEM
 ON DEM.INDV_SRC_ID=MCD.INDV_SRC_ID
JOIN
(SELECT MBR_PERS_SYS_ID, BTH_DT, MEDCD_ID, SRC_REC_CD FROM ECT_{env}_OBH_DP_DB.ETL.EDW_TB_DIM_MBR_L 
WHERE TRIM(MEDCD_ID)<>'''' AND TRIM(MEDCD_ID)<>''U'') EDWMCD
ON TRIM(EDWMCD.MEDCD_ID)=TRIM(MCD.INDV_KEY_VAL)  AND EDWMCD.BTH_DT=DEM.BIRTHDATE
)
UNION
(
SELECT DISTINCT EDWMDCR.MBR_PERS_SYS_ID as EDWPERSID, EDWMDCR.HICN,MDCR.INDV_SRC_ID AS IMDMID, MDCR.INDV_KEY_VAL, MDCR.CREAT_DTTM, MDCR.CHG_DTTM, EDWMDCR.SRC_REC_CD FROM
(SELECT DISTINCT INDV_SRC_ID, INDV_KEY_VAL,CREAT_DTTM, CHG_DTTM FROM ECT_{env}_INDIVIDUAL_DB.COMPACT.IMDM_INDV_KEY 
 WHERE TRIM(INDV_KEY_TYP_REF_DESC)=''hicns''AND SRC_REC_STS_CD=''true'')MDCR JOIN 
 (SELECT INDV_SRC_ID, BIRTHDATE FROM ECT_{env}_INDIVIDUAL_DB.COMPACT.IMDM_INDV_DEMOGRAPHICINFO WHERE UPPER(TRIM(ACTIVE))=''TRUE'') DEM
 ON DEM.INDV_SRC_ID=MDCR.INDV_SRC_ID
JOIN
(SELECT MBR_PERS_SYS_ID, BTH_DT, HICN, SRC_REC_CD FROM ECT_{env}_OBH_DP_DB.ETL.EDW_TB_DIM_MBR_L 
WHERE TRIM(HICN)<>'''' AND TRIM(HICN)<>''U'') EDWMDCR
ON TRIM(EDWMDCR.HICN)=TRIM(MDCR.INDV_KEY_VAL)  AND EDWMDCR.BTH_DT=DEM.BIRTHDATE
)
UNION
(
SELECT DISTINCT EDWMBI.MBR_PERS_SYS_ID as EDWPERSID, EDWMBI.MBI,MBI.INDV_SRC_ID AS IMDMID, MBI.INDV_KEY_VAL, MBI.CREAT_DTTM, MBI.CHG_DTTM, EDWMBI.SRC_REC_CD FROM
(SELECT DISTINCT INDV_SRC_ID, INDV_KEY_VAL, CREAT_DTTM, CHG_DTTM FROM ECT_{env}_INDIVIDUAL_DB.COMPACT.IMDM_INDV_KEY 
 WHERE TRIM(INDV_KEY_TYP_REF_DESC)=''medicareBeneficiaryIdentifiers''AND SRC_REC_STS_CD=''true'')MBI JOIN 
 (SELECT INDV_SRC_ID, BIRTHDATE FROM ECT_{env}_INDIVIDUAL_DB.COMPACT.IMDM_INDV_DEMOGRAPHICINFO WHERE UPPER(TRIM(ACTIVE))=''TRUE'') DEM
 ON DEM.INDV_SRC_ID=MBI.INDV_SRC_ID
JOIN
(SELECT MBR_PERS_SYS_ID, BTH_DT, MBI, SRC_REC_CD FROM ECT_{env}_OBH_DP_DB.ETL.EDW_TB_DIM_MBR_L 
WHERE TRIM(MBI)<>'''' AND TRIM(MBI)<>''U'') EDWMBI
ON TRIM(EDWMBI.MBI)=TRIM(MBI.INDV_KEY_VAL)  AND EDWMBI.BTH_DT=DEM.BIRTHDATE
)
UNION
(
SELECT DISTINCT MBR.MBR_PERS_SYS_ID as EDWPERSID,MBR.SSN, DEM.INDV_SRC_ID AS IMDMID, DEM.SSN, DEM.CREAT_DTTM, DEM.CHG_DTTM, MBR.SRC_REC_CD
FROM
(SELECT MBR_PERS_SYS_ID, BTH_DT, UPPER(TRIM(MBR_NM_FST_TXT)) AS FSTNM, UPPER(TRIM(MBR_NM_LST_TXT)) AS LSTNM, SSN, SRC_REC_CD FROM ECT_{env}_OBH_DP_DB.ETL.EDW_TB_DIM_MBR_L
WHERE TRIM(SSN)<>'''' AND TRIM(SSN)<>''U'') MBR INNER JOIN 
(SELECT INDV_SRC_ID, BIRTHDATE, SOCIALSECURITYNUMBER AS SSN, LASTUPDATED:sourceSystemTimestamp creat_dttm, LASTUPDATED:sourceSystemTimestamp cHG_dttm FROM ECT_{env}_INDIVIDUAL_DB.COMPACT.IMDM_INDV_DEMOGRAPHICINFO WHERE UPPER(TRIM(ACTIVE))=''TRUE'' AND SOCIALSECURITYNUMBER IS NOT NULL) DEM
ON MBR.BTH_DT = DEM.BIRTHDATE AND TRIM(MBR.SSN)=TRIM(DEM.SSN)
INNER JOIN (SELECT distinct indv_src_id, UPPER(TRIM(FIRSTNAME)) AS FSTNM,UPPER(TRIM(LASTNAME)) AS LSTNM FROM ECT_{env}_INDIVIDUAL_DB.COMPACT.IMDM_INDV_PERSONNAMES WHERE UPPER(TRIM(ACTIVE))=''TRUE'') NM
ON MBR.FSTNM=NM.FSTNM AND MBR.LSTNM=NM.LSTNM
AND NM.INDV_SRC_ID=DEM.INDV_SRC_ID
)
UNION
(
SELECT DISTINCT MBR.MBR_PERS_SYS_ID as EDWPERSID,MBR.SSN, DEM.INDV_SRC_ID AS IMDMID, DEM.SSN, DEM.CREAT_DTTM, DEM.CHG_DTTM, MBR.SRC_REC_CD
FROM
(SELECT MBR_PERS_SYS_ID, BTH_DT, UPPER(TRIM(MBR_NM_FST_TXT)) AS FSTNM, UPPER(TRIM(MBR_NM_LST_TXT)) AS LSTNM, SSN, SRC_REC_CD FROM ECT_{env}_OBH_DP_DB.ETL.EDW_TB_DIM_MBR_L) MBR 
INNER JOIN 
(SELECT INDV_SRC_ID, BIRTHDATE, SOCIALSECURITYNUMBER AS SSN, LASTUPDATED:sourceSystemTimestamp CREAT_DTTM, LASTUPDATED:sourceSystemTimestamp cHG_dttm FROM ECT_{env}_INDIVIDUAL_DB.COMPACT.IMDM_INDV_DEMOGRAPHICINFO WHERE UPPER(TRIM(ACTIVE))=''TRUE'') DEM
ON MBR.BTH_DT = DEM.BIRTHDATE
INNER JOIN (SELECT distinct indv_src_id, UPPER(TRIM(FIRSTNAME)) AS FSTNM,UPPER(TRIM(LASTNAME)) AS LSTNM FROM ECT_{env}_INDIVIDUAL_DB.COMPACT.IMDM_INDV_PERSONNAMES WHERE UPPER(TRIM(ACTIVE))=''TRUE'') NM
ON MBR.FSTNM=NM.FSTNM AND MBR.LSTNM=NM.LSTNM
AND NM.INDV_SRC_ID=DEM.INDV_SRC_ID
)
)IMDM));',CURRENT_TIMESTAMP),
