FOUNDATION.EPIM_PROV_DEDUP PROV
ON TRIM(PROV.IDENTIFIER)= TRIM(CLM.PHRM_NPI_PROV_ID)
AND TO_CHAR(CLM.PHRM_FILL_DT,''YYYY-MM-DD'') BETWEEN PROV.START_DATE AND PROV.END_DATE
