('ETL.IMDM_INDV_CHNG','COMPACT.IMDM_EDW_INDV_KEY','INSERT INTO COMPACT.IMDM_EDW_INDV_KEY(INDV_KEY_VAL,
 INDV_KEY_TYP_REF_DESC, CREAT_SYS_REF_CD ,CHG_SYS_REF_CD, DATA_SECUR_RULE_LIST, IMDM_SURRG_KEY,             
 INDV_SRC_ID, DW_SYS_REF_CD, SF_INSERT_DATETIME, SF_UPDATE_DATETIME,SF_PROCESS_ID)  
SELECT DISTINCT INDV_KEY_VAL,
 ''edwPersonIdentifier'' AS INDV_KEY_TYP_REF_DESC, INPUT_SRC_CD AS CREAT_SYS_REF_CD, 
 INPUT_SRC_CD AS CHG_SYS_REF_CD, 
 parse_json(''{"securityTag":"AR_DEV_OBHDPSAS_OPTUM_ROLE,AR_STG_OBHDPSAS_OPTUM_ROLE,AR_PRD_OBHDPSAS_OPTUM_ROLE"}''),''-999'' as IMDM_SURRG_KEY, IMDMID, ''EDW'',
 CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, ''101010''
FROM
(
SELECT DISTINCT EDWPERSID AS INDV_KEY_VAL, INPUT_SRC_CD, IMDMID FROM
(
SELECT DISTINCT MBR_PERS_SYS_ID AS EDWPERSID, INPUT_SRC_CD, INDV_SRC_ID AS IMDMID FROM
((SELECT DISTINCT MBR_PERS_SYS_ID, SOURCE_ID, INPUT_SRC_CD FROM COMPACT.ETL_BKT_MBR_SF WHERE TRIM(INPUT_SRC_CD)=''CES'') EDWCES
JOIN
(SELECT DISTINCT INDV_KEY_VAL, INDV_SRC_ID,IMDM_SURRG_KEY, concat(''CES-'',SUBSTR(INDV_KEY_VAL,0,7),''-'',SUBSTR(INDV_KEY_VAL,10,9),''-'',SUBSTR(INDV_KEY_VAL,20,1),''-'',
  SUBSTR(INDV_KEY_VAL,22,2)) as mbr_alt_id FROM COMPACT.IMDM_EDW_INDV_KEY
WHERE  TRIM(CREAT_SYS_REF_CD)=''CDB_CS'' AND TRIM(INDV_KEY_TYP_REF_DESC)=''sourceId'' )CES
ON TRIM(EDWCES.SOURCE_ID)=TRIM(CES.INDV_KEY_VAL) )
UNION
SELECT DISTINCT MBR_PERS_SYS_ID AS EDWPERSID, INPUT_SRC_CD, IMDMID FROM
( (SELECT distinct indv.indv_key_val srcid, indv.indv_src_id imdmid, INDV.IMDM_SURRG_KEY,
  concat(''CSP-'',TRIM(pol.INDV_KEY_VAL),''-'',SUBSTR(indv.INDV_KEY_VAL,0,9),''-'',SUBSTR(indv.INDV_KEY_VAL,12,1)) as mbr_alt_id
FROM (select distinct indv_key_val, indv_src_id,IMDM_SURRG_KEY, CREAT_DTTM, CHG_DTTM from COMPACT.IMDM_EDW_INDV_KEY
WHERE  TRIM(CREAT_SYS_REF_CD)=''CSP_Facets'' AND TRIM(INDV_KEY_TYP_REF_DESC)=''sourceId'') indv
inner join
(select distinct indv_key_val, indv_src_id,IMDM_SURRG_KEY from COMPACT.IMDM_EDW_INDV_KEY
WHERE  TRIM(CREAT_SYS_REF_CD)=''CSP_Facets'' AND TRIM(INDV_KEY_TYP_REF_DESC)=''policyNumber'')pol
on pol.INDV_SRC_ID=indv.INDV_SRC_ID and indv.IMDM_SURRG_KEY=pol.IMDM_SURRG_KEY) IMDMCSP JOIN
(SELECT DISTINCT MBR_PERS_SYS_ID, SOURCE_ID, INPUT_SRC_CD FROM COMPACT.ETL_BKT_MBR_SF WHERE TRIM(INPUT_SRC_CD)=''CSP'') EDWCSP
ON TRIM(EDWCSP.SOURCE_ID)=TRIM(IMDMCSP.srcid) )
union
SELECT DISTINCT MBR_PERS_SYS_ID AS EDWPERSID, INPUT_SRC_CD, IMDMID FROM
( (select distinct indv_key_val SRCID, indv_src_id IMDMID,IMDM_SURRG_KEY from COMPACT.IMDM_EDW_INDV_KEY
WHERE  TRIM(CREAT_SYS_REF_CD)=''CR'' AND TRIM(INDV_KEY_TYP_REF_DESC)=''sourceId'' ) indv
inner join
(SELECT DISTINCT MBR_PERS_SYS_ID, SOURCE_ID, INPUT_SRC_CD FROM COMPACT.ETL_BKT_MBR_SF WHERE TRIM(INPUT_SRC_CD)=''CRR'') EDWCR
ON TRIM(EDWCR.SOURCE_ID)=TRIM(INDV.SRCID))
UNION
SELECT DISTINCT MBR_PERS_SYS_ID AS EDWPERSID, INPUT_SRC_CD, IMDMID FROM
( (select indv_src_id IMDMID, indv_key_val SRCID, imdm_surrg_key from COMPACT.IMDM_EDW_INDV_KEY
   WHERE TRIM(CREAT_SYS_REF_CD)=''OHBS_Facets'' AND TRIM(INDV_KEY_TYP_REF_DESC)=''sourceId'')indv
  JOIN
(SELECT DISTINCT MBR_PERS_SYS_ID, SOURCE_ID, INPUT_SRC_CD FROM COMPACT.ETL_BKT_MBR_SF WHERE TRIM(INPUT_SRC_CD)=''FCET'') EDWOHBS
ON TRIM(EDWOHBS.SOURCE_ID)=TRIM(INDV.SRCID) )
UNION
SELECT DISTINCT MBR_PERS_SYS_ID AS EDWPERSID, INPUT_SRC_CD, IMDMID FROM
( (select indv_src_id IMDMID, indv_key_val SRCID, imdm_surrg_key from COMPACT.IMDM_EDW_INDV_KEY
   WHERE TRIM(CREAT_SYS_REF_CD)=''CDB_OX'' AND TRIM(INDV_KEY_TYP_REF_DESC)=''sourceId'')indv
  JOIN
(SELECT DISTINCT MBR_PERS_SYS_ID, SOURCE_ID, INPUT_SRC_CD FROM COMPACT.ETL_BKT_MBR_SF WHERE TRIM(INPUT_SRC_CD)=''OXF'') EDWOHBS
ON TRIM(EDWOHBS.SOURCE_ID)=TRIM(INDV.SRCID) )
UNION
SELECT DISTINCT MBR_PERS_SYS_ID AS EDWPERSID, INPUT_SRC_CD, IMDMID FROM
( (select indv_src_id IMDMID, indv_key_val SRCID, imdm_surrg_key from COMPACT.IMDM_EDW_INDV_KEY
   WHERE TRIM(CREAT_SYS_REF_CD)=''LINX'' AND TRIM(INDV_KEY_TYP_REF_DESC)=''sourceId'')indv
  JOIN
(SELECT DISTINCT MBR_PERS_SYS_ID, SOURCE_ID, INPUT_SRC_CD FROM COMPACT.ETL_BKT_MBR_SF WHERE TRIM(INPUT_SRC_CD)=''MEMP'') EDWOHBS
ON TRIM(EDWOHBS.SOURCE_ID)=TRIM(INDV.SRCID) )
UNION
SELECT DISTINCT MBR_PERS_SYS_ID AS EDWPERSID, INPUT_SRC_CD, IMDMID FROM
(  (select indv_src_id IMDMID, indv_key_val SRCID, imdm_surrg_key from COMPACT.IMDM_EDW_INDV_KEY
   WHERE TRIM(CREAT_SYS_REF_CD)=''CDB_CO'' AND TRIM(INDV_KEY_TYP_REF_DESC)=''sourceId'')indv
  JOIN
(SELECT DISTINCT MBR_PERS_SYS_ID, SOURCE_ID, INPUT_SRC_CD FROM COMPACT.ETL_BKT_MBR_SF WHERE TRIM(INPUT_SRC_CD)=''COSM'') EDWOHBS
ON TRIM(EDWOHBS.SOURCE_ID)=TRIM(INDV.SRCID) )
) );',CURRENT_TIMESTAMP),
('COMPACT.IMDM_EDW_INDV_KEY','COMPACT.IMDM_INDV',
'INSERT INTO COMPACT.IMDM_INDV(IMDM_ID,SRC_CD,BTH_DT,GDR_CD,SSN,FST_NM,LST_NM,MDCDID,SBSCRID,MDCRID,URSLID,EDWPRSID,SMRTPRSID, DCSD_DT,ADDR_LN_1,ADDR_LN_2,ADDR_LN_3,CTY_NM,CNTY_NM,CNTRY_CD,ST_CD,PST_CD,LAT,LONG,ADDR_VLD_IND,ADDR_STD_IND,ADDR_PRF_IND,PH_NBR,SF_INSERT_DATETIME,SF_UPDATE_DATETIME)
SELECT DISTINCT case when TRIM(INDV.INDV_ID) is null then ''-1'' else TRIM(INDV.INDV_ID) end AS IMDM_ID, INDV.SRC_CD,INDV.BTH_DT AS BTH_DT,INDV.GDR_TYP_CD AS GDR_CD,
case when TRIM(INDV.SSN) is null then ''-1'' else TRIM(INDV.SSN) end AS SSN, PNM.FST_NM AS MBR_NM_FST_TXT, PNM.LST_NM AS MBR_NM_LST_TXT,
case when TRIM(MDCD.MDCDID) is null then ''-1'' else TRIM(MDCD.MDCDID) end as mdcdid , case when TRIM(SBSCR.SBSCRID) is null then ''-1'' else TRIM(SBSCR.SBSCRID) end as SBSCRID ,
case when TRIM(MDCR.MDCRID) is null then ''-1'' else TRIM(MDCR.MDCRID) end as mdcrid, case when TRIM(ursulaIds.URSLID) is null then ''-1'' else TRIM(ursulaIds.URSLID) end urslid ,
case when EDW.EDWPERSID is null then ''-1'' else EDW.EDWPERSID end persid ,case when smrt.DIamond_ID is null then ''-1'' else smrt.DIamond_ID end smrtid, smrt.dod,
LN_1_TXT, LN_2_TXT,LN_3_TXT, TRIM(TN_NM), TRIM(CNTY), TRIM(CNTRY), TRIM(ST_PRVC_CD), TRIM(PST_CD), LAT, LNG, VLD_IND, STD_FMTTING_IND, PREF_IND,
TRIM(TEL_NBR), current_timestamp, current_timestamp
FROM (select INDV_ID,SRC_CD,SSN, FST_NM, LST_NM,BTH_DT, DCSD_DT, GDR_TYP_CD FROM ECT_{env}_INDIVIDUAL_DB.FOUNDATION.DW_INDV WHERE UPPER(DW_SYS_REF_CD)=''IMDM'' AND UPPER(DW_SRC_REC_STS_CD)=''TRUE'') INDV
join (SELECT * FROM ECT_{env}_INDIVIDUAL_DB.FOUNDATION.DW_INDV WHERE UPPER(DW_SYS_REF_CD)=''IMDM'' AND UPPER(DW_SRC_REC_STS_CD)=''TRUE''AND NM_TYP_DESC = ''Preferred'') PNM
ON INDV.INDV_ID=PNM.INDV_ID
left outer JOIN
(SELECT DISTINCT INDV_KEY_VAL AS SBSCRID, INDV_SRC_ID
 FROM COMPACT.IMDM_EDW_INDV_KEY
  WHERE INDV_KEY_TYP_REF_DESC=''subscriberId'' ) SBSCR
ON INDV.INDV_ID = SBSCR.INDV_SRC_ID
LEFT OUTER JOIN
(SELECT DISTINCT INDV_KEY_VAL AS MDCDID, INDV_SRC_ID FROM COMPACT.IMDM_EDW_INDV_KEY
  WHERE INDV_KEY_TYP_REF_DESC=''medicaidRecipientNumber'')MDCD
  ON INDV.INDV_ID=MDCD.INDV_SRC_ID
LEFT OUTER JOIN
(SELECT DISTINCT INDV_KEY_VAL AS MDCRID, INDV_SRC_ID FROM COMPACT.IMDM_EDW_INDV_KEY
  WHERE INDV_KEY_TYP_REF_DESC IN(''medicareBeneficiaryIdentifiers'', ''hicns''))MDCR
  ON INDV.INDV_ID=MDCR.INDV_SRC_ID
  LEFT OUTER JOIN
  (SELECT DISTINCT INDV_KEY_VAL AS URSLID, INDV_SRC_ID FROM COMPACT.IMDM_EDW_INDV_KEY
  WHERE INDV_KEY_TYP_REF_DESC =''ursulaIds'')ursulaIds
  ON INDV.INDV_ID=ursulaIds.INDV_SRC_ID
  LEFT OUTER JOIN
  (SELECT DISTINCT INDV_KEY_VAL AS EDWPERSID, INDV_SRC_ID FROM COMPACT.IMDM_EDW_INDV_KEY
  WHERE INDV_KEY_TYP_REF_DESC =''edwPersonIdentifier'')EDW
  ON INDV.INDV_ID=EDW.INDV_SRC_ID
  LEFT OUTER JOIN
(SELECT ADDR.INDV_ID, ADR_TYP_DESC, BEGN_DT,END_DT,LN_1_TXT,LN_2_TXT,LN_3_TXT, TN_NM, CNTY, ISO_CNTRY_CD AS CNTRY, ST_PRVC_CD, PST_CD, LAT, LNG, VLD_IND, STD_FMTTING_IND, PREF_IND
FROM  (SELECT * FROM ECT_{env}_INDIVIDUAL_DB.FOUNDATION.DW_INDV_PST_ADR WHERE UPPER(DW_SYS_REF_CD)=''IMDM'' AND UPPER(DW_SRC_REC_STS_CD)=''TRUE'') ADDR  JOIN
(SELECT INDV_ID, MAX(BEGN_DT) DT FROM ECT_{env}_INDIVIDUAL_DB.FOUNDATION.DW_INDV_PST_ADR WHERE UPPER(DW_SYS_REF_CD)=''IMDM'' AND UPPER(DW_SRC_REC_STS_CD)=''TRUE'' AND PRI_IND=''true''AND (END_DT IS NULL OR END_DT =''9999-12-31'') GROUP BY INDV_ID) PRIADDR
ON PRIADDR.INDV_ID=ADDR.INDV_ID
AND PRIADDR.DT=ADDR.BEGN_DT
WHERE PRI_IND=''true''
)INDVADR
ON INDV.INDV_ID=INDVADR.INDV_ID
LEFT OUTER JOIN
(SELECT DISTINCT INDV_ID, PREF_IND AS PHPREFIND, pri_ind, TEL_NBR
FROM ECT_{env}_INDIVIDUAL_DB.FOUNDATION.DW_INDV_TEL_NBR  WHERE UPPER(DW_SYS_REF_CD)=''IMDM'' AND UPPER(DW_SRC_REC_STS_CD)=''TRUE'' AND CMNCT_TYP_DESC=''Home Telephone'')tel
on INDV.INDV_ID=TEL.INDV_ID
left outer join
(SELECT DISTINCT DIAMOND_ID, SUBSCRIBER_ID, MEDICAID_NO,DOB, DOD, GENDER, SOCIAL_SEC_NO as ssn, MEMB_FIRST_NAME, MEMB_LAST_NAME
FROM COMPACT.DIM_MEMBER) smrt
on smrt.DOB= indv.BTH_DT and smrt.MEDICAID_NO=mdcd.MDCDID and INDV.INDV_ID=MDCD.INDV_SRC_ID;',CURRENT_TIMESTAMP),
